            PackedIntPermTableAlignedPtr             = (int *) PackedIntPermTable.AlignSpan(PAGE_SIZE);
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        internal static Vector256<int> GetIntPermutationAligned(int * pBase, ulong index)
        {
            Debug.Assert(index <= 255);
            Debug.Assert(pBase != null);
            Debug.Assert(((ulong) (pBase + index * 8)) % 32 == 0);
            return Avx.LoadAlignedVector256(pBase + index * 8);
        }
    }


